import React from "react";
import { Button } from "primereact/button"; 
import "./App.css";

const Home = () => {

  const navigateToLeaderboard = () => {
    window.location.href = "/leaderboard"; 
  };

  const navigateToWinners = () => {
    window.location.href = "/winners";
  };

  const navigateToUpdateScore = () => {
    window.location.href = "/updateScore";
  };

  const navigateToDistributePrize = () => {
    window.location.href = "/distributePrize";
  };

  return (
    <div className="container">
      <div className="home-header">
        <h1>Ana Menu</h1>
        <p>Haftanın kazananlarını incelemek, liderlik tablosunu görüntülemek, skor güncellemek ve  ödül dağıtımı yapmak için aşağıdaki düğmelere tıklayın.</p>
      </div>

      <div className="home-buttons">
        <Button
          label="Liderlik Tablosu"
          icon="pi pi-list"
          onClick={navigateToLeaderboard}
          className="p-button-primary p-button-rounded"
        />&nbsp;
        
        <Button
          label="Haftanın Kazananları"
          icon="pi pi-trophy"
          onClick={navigateToWinners}
          className="p-button-success p-button-rounded"
        />&nbsp;

        <Button
          label="Skoru Güncelle"
          icon="pi pi-pencil"
          onClick={navigateToUpdateScore}
          className="p-button-success p-button-rounded"
        />&nbsp;
        
        <Button
          label="Ödülleri Dağıt"
          icon="pi pi-gift"
          onClick={navigateToDistributePrize}
          className="p-button-success p-button-rounded"
        />
      </div>
    </div>
  );
};

export default Home;
